Yesterday was a frustrating art day for me. I sketched out today‚Äôs 30daysofbiblelettering verse as I normally do, and just needed to watercolor-ify (totally a word btw). I COULD NOT FOR THE LIFE OF ME DO IT. So much wasted watercolor paper ü§¶üèª‚Äç‚ôÄÔ∏è. After a few hours I gave up. It‚Äôs a spectacular verse full of truth and triumph, but apparently it isn‚Äôt want God wanted me to hear at the moment.

This morning I hopped into my usual routine of quiet time. I came across this excerpt from Horatius Bonar: ‚ÄúIn so far as my actual safety is concerned, everything depends on God being for me; and in so far as my present peace is concerned, everything depends on my knowing that God is for me. Nothing can calm the tempest of my soul, save the knowledge that I am His, and that He is mine.‚Äù

I‚Äôve been in this season of peace-searching and I know God needed to cap off my journey reminding me this. Anyone else searching for an all encompassing, worry-quenching peace? You are His and He is yours. üíõ
